import React, { useState } from "react";
import axios from "axios";

function App() {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [loggedInUser, setLoggedInUser] = useState(null);
  const [message, setMessage] = useState("");

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post("http://localhost:5001/api/users/login", {
        username,
        password,
      });
      const { token, userId } = response.data;
      localStorage.setItem("token", token);
      localStorage.setItem("userId", userId);
      setLoggedInUser({ username });
      setMessage("Đăng nhập thành công!");
    } catch (error) {
      setMessage(error.response?.data?.message || "Đăng nhập thất bại.");
    }
  };

  const handleLogout = () => {
    localStorage.removeItem("token");
    localStorage.removeItem("userId");
    setLoggedInUser(null);
    setMessage("Đã đăng xuất.");
  };

  return (
    <div className="container mt-4">
      <h2 className="text-center mb-4">Dashboard</h2>

      {/* Login Section */}
      <div className="mb-3">
        <h5>Login</h5>
        <form className="d-flex gap-2" onSubmit={handleLogin}>
          <input
            type="text"
            className="form-control"
            placeholder="Username"
            value={username}
            onChange={(e) => setUsername(e.target.value)}
            required
          />
          <input
            type="password"
            className="form-control"
            placeholder="Password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
          <button type="submit" className="btn btn-primary">
            Login
          </button>
        </form>

        {loggedInUser && (
          <div>
            <p>Xin chào, {loggedInUser.username}</p>
            <button className="btn btn-secondary" onClick={handleLogout}>
              Đăng xuất
            </button>
          </div>
        )}

        {message && <p>{message}</p>}
      </div>

      {/* Dashboard Layout */}
      <div className="row">
        {/* Map Section */}
        <div className="col-lg-6">
          <h5>Map</h5>
          <div className="map-container d-flex justify-content-center align-items-center">
            <p>Map will be displayed here</p>
          </div>
        </div>

        {/* Vehicle List */}
        <div className="col-lg-3">
          <h5>Vehicles</h5>
          <ul className="list-group">
            <li className="list-group-item">Vehicle 1</li>
            <li className="list-group-item">Vehicle 2</li>
            <li className="list-group-item">Vehicle 3</li>
            <li className="list-group-item">Vehicle 4</li>
          </ul>
        </div>

        {/* Station List */}
        <div className="col-lg-3">
          <h5>Stations</h5>
          <ul className="list-group">
            <li className="list-group-item">Station A</li>
            <li className="list-group-item">Station B</li>
            <li className="list-group-item">Station C</li>
          </ul>
        </div>
      </div>
    </div>
  );
}

export default App;
